    limb_vector1_2 = B2_0(:,i) + P - A2_0(:,i);
    limb_vector1_3 = B3_0(:,i) + P - A3_0(:,i);

    % 第二层的驱动杆的方向向量
    limb_vector2_1 = C1_1(:,i) + P - B1_1(:,i);
    limb_vector2_2 = C2_1(:,i) + P - B2_1(:,i);
    limb_vector2_3 = C3_1(:,i) + P - B3_1(:,i);

    % 第三层的驱动杆的方向向量
    limb_vector3_1 = D1_2(:,i) + P - C1_2(:,i);
    limb_vector3_2 = D2_2(:,i) + P - C2_2(:,i);
    limb_vector3_3 = D3_2(:,i) + P - C3_2(:,i);

    % 第四层的驱动杆的方向向量
    limb_vector4_1 = E1_3(:,i) + P - D1_3(:,i);
    limb_vector4_2 = E2_3(:,i) + P - D2_3(:,i);
    limb_vector4_3 = E3_3(:,i) + P - D3_3(:,i);

    % 第五层的驱动杆的方向向量
    limb_vector5_1 = F1_4(:,i) + P - E1_4(:,i);
    limb_vector5_2 = F2_4(:,i) + P - E2_4(:,i);
    limb_vector5_3 = F3_4(:,i) + P - E3_4(:,i);   

    % 第六层的驱动杆的方向向量
    limb_vector6_1 = G1_5(:,i) + P - F1_5(:,i);
    limb_vector6_2 = G2_5(:,i) + P - F2_5(:,i);
    limb_vector6_3 = G3_5(:,i) + P - F3_5(:,i); 


    % 第一层驱动杆单位向量
    unit_vector1_1 = limb_vector1_1/sqrt(limb_vector1_1'*limb_vector1_1);
    unit_vector1_2 = limb_vector1_2/sqrt(limb_vector1_2'*limb_vector1_2);
    unit_vector1_3 = limb_vector1_3/sqrt(limb_vector1_3'*limb_vector1_3);

    % 第二层驱动杆单位向量
    unit_vector2_1 = limb_vector2_1/sqrt(limb_vector2_1'*limb_vector2_1);
    unit_vector2_2 = limb_vector2_2/sqrt(limb_vector2_2'*limb_vector2_2);
    unit_vector2_3 = limb_vector2_3/sqrt(limb_vector2_3'*limb_vector2_3);

    % 第三层驱动杆单位向量
    unit_vector3_1 = limb_vector3_1/sqrt(limb_vector3_1'*limb_vector3_1);
    unit_vector3_2 = limb_vector3_2/sqrt(limb_vector3_2'*limb_vector3_2);
    unit_vector3_3 = limb_vector3_3/sqrt(limb_vector3_3'*limb_vector3_3);

    % 第四层驱动杆单位向量
    unit_vector4_1 = limb_vector4_1/sqrt(limb_vector4_1'*limb_vector4_1);
    unit_vector4_2 = limb_vector4_2/sqrt(limb_vector4_2'*limb_vector4_2);
    unit_vector4_3 = limb_vector4_3/sqrt(limb_vector4_3'*limb_vector4_3);
    
    % 第五层驱动杆单位向量
    unit_vector5_1 = limb_vector5_1/sqrt(limb_vector5_1'*limb_vector5_1);
    unit_vector5_2 = limb_vector5_2/sqrt(limb_vector5_2'*limb_vector5_2);
    unit_vector5_3 = limb_vector5_3/sqrt(limb_vector5_3'*limb_vector5_3);

